rs":[],"fills":[],"shadows":[],"opacity":1,"content":"关闭","color":{"r":37,"g":208,"b":195,"a":1},"fontSize":16,"fontFace":"MicrosoftYaHei","textAlign":"center","letterSpacing":0,"lineHeight":40},{"objectID":"A5B3D0C1-9D27-4E7A-9D75-4C883BD40C02","type":"text","name":"为获得“牛盾云加速”服务，服务使用人（以","rect":{"x":518,"y":183.96895787139692,"width":885,"height":2456.0920177383596},"exportSizes":[],"rotation":0,"radius":null,"borders":[],"fills":[],"shadows":[],"opacity":1,"content":"为获得“牛盾云加速”服务，服务使用人（以下称“用户”）应当同意本服务条款，才能完成申请流程并通过“牛盾云加速”的审核。用户在向“牛盾云加速”提出用户注册申请时，首先签订了该服务条款后才可提交申请。\n一、服务内容\n1、牛盾云加速为网站提供云加速、云防护的服务平台 ，所提供的服务包括但不限于：网站访问加速、网站防火墙、DDOS保护、CC保护、智能DNS解析、盗链保护、页面压缩、缓存加速和永久在线等服务。\n二、服务规则\n用户申请\n1、用户在申请“牛盾云加速”服务时，应提供真实、完整和准确的信息及证明材料。如因故意或过失未向牛盾云加速提供真实、完整和准确的信息，导致牛盾云加速验证错误，造成相关各方损失的，由用户承担一切责任。\n2、用户提交申请应遵守牛盾云加速的流程及规则\n审核\n1、审核标准由牛盾云加速自行拟定。\n2、综合审核：根据网站知名度、PR、alexa、行业资质、是否涉及金钱交易、是否存在敏感信息、搜索引擎排名等进行的综合评分，如果评分不达标的话，审核不通过。\n以上项目如果有一项不通过就表示审核不通过。\n3、 “牛盾云加速” 用户在审核通过后，用户会收到牛盾云加速的通过邮件通知。不符合审核要求的网站，会收到牛盾云加速发送的不能通过的邮件。\n信息更新\n1、“牛盾云加速”用户资料若有任何变动，必须及时到网站进行更新。\n2、 申请资料中所有项目一旦有任何的变动，用户都需要重新提交修改信息进行修改。否则，由于未得到及时更新的信息所引起的后果由用户自行承担。\n3、 申请资料中的某些项目出现了变动，但由于“牛盾云加速”未得到用户提交的信息更新申请，从而导致在每年的审核结果中出现用户信息有误而停止对用户进行验证服务，由此所引起的后果由用户自行承担。\n注销\n1、如果用户不希望继续使用牛盾云加速，用户应当立即在牛盾云加速中删除网站。\n2、如果因网站终止等原因致用户主体不存在的，“牛盾云加速”将按照审核标准中网站信息不实而终止对用户提供的服务，有权注销该网站的验证信息。\n3、对于下列情形之一，牛盾云加速有权主动注销用户的牛盾云加速服务，并无需事先通知用户：\na) 用户申请验证时，提供不真实信息；\nb) 用户享受牛盾云加速服务过程中，不再符合审核标准所列明的条件；\nc) 使用任何非法手段获取“牛盾云加速”服务；\nd) 利用“牛盾云加速”网络服务系统进行任何可能对互联网造成不利影响的行为；\ne) 利用“牛盾云加速”服务系统进行任何不利于“牛盾云加速”或有违相关法律法规规定的行为；\nf) 用户不能履行或违反了相关法律、法规和本服务条款所规定的责任和义务；\ng) 法律、法规规定的其他情形。\n4、“牛盾云加速”服务注销前，用户因使用该“牛盾云加速”服务给他人造成损失的，由用户承担赔偿责任。\n三、用户信息保护\n1、“牛盾云加速”不得泄露用户的保密信息（不包括查询页面需要公布的信息），更不得以任何缘由对用户的隐私信息进行公布。\n四、版权声明\n1、牛盾云加速对其所提供的服务内容，包括但不限于文字、软件、数据库、声音、图片、录像、图表等，拥有所有权和使用权。所有这些内容受版权、商标、专利和其它财产所有权法律的保护。\n2、任何人不得擅自以非法的方式传播、修改和使用本网站所提供的内容。\n五、免责声明\n1、用户知悉并理解，牛盾云加速经过详细的测试，但不能保证与所有的软硬件系统完全兼容，不能保证本服务完全没有错误，如果出现不兼容及服务错误的情况，用户可寻求技术支持以解决问题。牛盾云加速就此情形不承担任何责任。\n2、用户明确同意其使用“牛盾云加速”服务所存在的风险将完全由其自己承担；在适用法律允许的最大范围内，对因使用或不能使用“牛盾云加速”服务所产生的损害及风险，包括但不限于直接或间接的个人损害、商业赢利的丧失、贸易中断、商业信息的丢失或任何其它经济损失，牛盾云加速不承担任何责任。\n3、牛盾云加速不保证提供的功能及服务一定能满足用户的要求，也不担保服务不会中断，对服务的及时性、安全性、真实性、准确性都不作担保。\n4、对于因电信系统或互联网网络故障、计算机故障或病毒、信息损坏或丢失、计算机系统问题或其它任何不可抗力原因而产生损失，牛盾云加速不承担任何责任。\n5、用户违反本服务条款规定，对牛盾云加速造成损害的，牛盾云加速有权采取包括但不限于中断使用许可、停止提供服务、限制使用、法律追究等措施。\n6、如因系统维护或升级的需要而必须暂停网络服务，“牛盾云加速”将尽可能事先发布通告。\n7、用户对其网站内容承担全部法律责任，任何因网站内容而产生的侵权责任均由用户自行承担 。\n六、条款修改\n1、牛盾云加速有权随时修改本条款的有关内容，一旦本条款的内容发生变动，“牛盾云加速”将通过适当方式作解释说明。\n2、如果用户不同意牛盾云加速对本条款相关内容所做的修改，有权停止使用“牛盾云加速”服务。如果用户继续使用“牛盾云加速”服务，则视为接受“牛盾云加速”对本服务条款相关内容所做的修改。\n本条款的更新修改及最终解释权归牛盾云加速所有。\n由于网站及其经营主体信息因经营主体内部业务和管理需要可能变更，用户的验证信息也会随经营主体业务和管理情况发生变化，但由于信息不能得到实时更新，所以上述审核信息仅供参考","color":{"r":131,"g":139,"b":156,"a":1},"fontSize":14,"fontFace":"MicrosoftYaHei","textAlign":"left","letterSpacing":0,"lineHeight":24},{"objectID":"D3964DA3-446D-49F1-8D7F-F9FDAF12DD4A","type":"text","name":"服务条款","rect":{"x":518,"y":127.98965262379897,"width":122,"height":25.990391722099048},"exportSizes":[],"rotation":0,"radius":null,"borders":[],"fills":[],"shadows":[],"opacity":1,"content":"服务条款","color":{"r":131,"g":139,"b":156,"a":1},"fontSize":20,"fontFace":"MicrosoftYaHei","textAlign":"left","letterSpacing":0,"lineHeight":26},{"objectID":"B1FDC24E-CABB-4095-8676-B6873F5252B8","type":"slice","name":"close--gray","rect":{"x":1399,"y":110,"width":24,"height":24},"exportSizes":[{"sliceName":"slices/close--gray.png","scale":"1","suffix":"","format":"png"}],"rotation":0,"radius":null,"borders":[],"fills":[],"shadows":[],"opacity":1}],"notes":[{"rect":{"x":1421,"y":210,"width":119,"height":22},"note":"关闭 modal view"},{"rect":{"x":1433,"y":362,"width":462,"height":24},"note":"画面水平置中; 垂直置中，但高度如果超过画面高度，离视窗上下各100px"},{"rect":{"x":2831,"y":2992,"width":119,"height":22},"note":"关闭 modal view"}],"objectID":"A3119DF9-9BE0-4034-80ED-F960F401EF36","name":"module_popup_service-terms","imageBase64":"iVBORw0KGgoAAAANSUhEUgAAB4AAAAtaCAYAAABbpx/7AAAAAXNSR0IArs4c6QAAQABJREFUeAHs3WeYXEWa6PmQQR4kJEAS3ggnvPDee++7ob3vmTsz   <body class="off">
    <div class="header">
      <div class="art-name">
        <h1 id="artboard" class="artboard-name"><span></span></h1>
      </div>

      <div id="about" class="about"><span></span></div>
      <div id="about_list" class="about_list dropdown hide">
        <div class="github"><a href="http://www.sketchchina.com/read-21.html" target="_blank">插件中文版</a></div>
        <div class="github"><a href="https://github.com/utom/sketch-measure" target="_blank">插件英文版</a></div>
        <div class="email"><a href="http://www.sketchchina.com/" target="_blank">Sketch中国社区</a></div>
        
        

      </div>

      <div id="resolution" class="resolution"><span></span></div>
      <div id="resolution_list" class="resolution_list dropdown hide"></div>

      <div id="color_format" class="color_format"><span></span></div>

      <div id="toggle" class="toggle"><span class="toggle_hide">隐藏/显示标注</span></div>

      <script id="list-item-template" type="application/template">
        <div>${name}</div>
      </script>

    </div>
    <div class="main">
      <div id="screen" class="screens">
        <div id="guide_horizontal" class="guide horizontal"></div>
        <div id="guide_vertical" class="guide vertical"></div>
        <div id="layers">
          <a class="layer selected">
            <i class="lt"></i><i class="rt"></i><i class="lb"></i><i class="rb"></i>
          </a>
          <a class="layer hover">
            <i class="lt"></i><i class="rt"></i><i class="lb"></i><i class="rb"></i>
          </a>
        </div>

        <script id="layer-item-template" type="application/template">
          <div id="ID-${objectID}" class="layer" style="left: ${x}px; top: ${y}px; width: ${width}px; height: ${height}px;">
            <i class="lt"></i><i class="rt"></i><i class="lb"></i><i class="rb"></i>
          </div>
        </script>
        <script id="edge-item-template" type="application/template">
          <div class="edge ${position}" style="left: ${x}px; top: ${y}px; width: ${width}px; height: ${height}px;"></div>
        </script>
        <script id="note-item-template" type="application/template">
          <div class="pin" style="left: ${x}px; top: ${y}px;">${index}</div>
        </script>

        <div id="guide_size_width" class="size width"><div class="label"></div></div>
        <div id="guide_size_height" class="size height"><div class="label"></div></div>

        <div id="guide_top" class="distance height">
          <i class="arrow start"></i>
          <i class="arrow end"></i>
          <i class="line"></i>
          <div class="label"></div>
        </div>
        <div id="guide_right" class="distance width">
          <i class="arrow start"></i>
          <i class="arrow end"></i>
          <i class="line"></i>
          <div class="label"></div>
        </div>
        <div id="guide_bottom" class="distance height">
          <i class="arrow start"></i>
          <i class="arrow end"></i>
          <i class="line"></i>
          <div class="label"></div>
        </div>
        <div id="guide_left" class="distance width">
          <i class="arrow start"></i>
          <i class="arrow end"></i>
          <i class="line"></i>
          <div class="label"></div>
        </div>
        <div id="note_tip" class="note" ></div>
      </div>

      <div id="zoom" class="zoom-box">
        <div class="zoom-out"><div class="minus"></div></div>
        <div class="zoom-text"></div>
        <div class="zoom-in"><div class="plus"></div></div>
      </div>
    </div>

    <div id="navbar" class="navbar navoff">
      <div id="tabs" class="tabs">
        <div class="a-tab current">Artboards</div>
        <div class="s-tab">Slices</div>
      </div>
      <div id="artboard_list" class="artboard_list"></div>
      <div id="slice_list" class="slice_list"></div>
    </div>
    <script id="artboard-item-template" type="application/template">
      <div class="a-item">
        <div class="a-image" style="background-image:url(data:image/png;base64,${base64});background-size:${width} ${height};"></div>
        <div class="a-name">${name}</div>
      </div>
    </script>

    <script id="slice-item-template" type="application/template">
      <div class="s-item">
          <div class="s-image"><div style="background-image:url(${sliceName});background-size:${width} ${height};"></div></div>
          <div class="s-name"></div>
        </div>
    </script>

    <div id="sidebar" class="sidebar sideoff">
      <div id="properties">
        <h3 id="side-title">PROPERTIES</h3>
        <ul></ul>
      </div>

      <div id="typeface">
        <h3 id="side-title">TYPEFACE</h3>
        <ul></ul>
      </div>

      <div id="content">
        <h3 id="side-title">CONTENT</h3>
        <ul></ul>
      </div>

      <div id="fills">
        <h3 id="side-title">FILLS</h3>
        <ul></ul>
      </div>

      <div id="borders">
        <h3 id="side-title">BORDERS</h3>
        <ul></ul>
      </div>

      <div id="shadows">
        <h3 id="side-title">SHADOWS</h3>
        <ul></ul>
      </div>

      <div id="exportable">
        <h3 id="side-title">EXPORTABLE</h3>
        <ul>
          <li></li>
        </ul>
      </div>

      <script id="slice-template" type="application/template">
        <a href="${sliceName}" class="download"><img src="${sliceName}" alt="" />${fileName}</a> 
      </script>

      <script id="property-template" type="application/template">
        <li><label>position:</label> <strong>${x}</strong> <i>,</i> <strong>${y}</strong></li>
        <li><label>size:</label> <strong>${width}</strong> <i>,</i> <strong>${height}</strong></li>
        <li class="opacity"><label>opacity:</label> <strong>${opacity}</strong></li>
        <li class="radius"><label>radius:</label> <strong>${radius}</strong></li>
      </script>

      <script id="type-template" type="application/template">
        <li><strong>${face}</strong></li>
        <li><label>size:</label> <strong>${size}</strong></li>
        <li><label>line:</label> <strong>${line}</strong></li>
      </script>

      <script id="content-template" type="application/template">
        <li><strong>${content}</strong></li>
      </script>

      <script id="color-template" type="application/template">
        <li><i class="connect"></i><em class="color" style="background-color: rgba(${r}, ${g}, ${b}, ${a})"></em> <strong class="color-text normal">${hex}, ${alpha}</strong><strong class="color-text rgba">rgba(${r}, ${g}, ${b}, ${a})</strong><strong class="color-text argb">${argb}</strong> </li>
      </script>

      <script id="border-template" type="application/template">
        <li><strong>${position}</strong></li>
        <li><label>thickness:</label> <strong>${thickness}</strong></li>
      </script>

      <script id="shadow-template" type="application/template">
        <li><strong>${type}</strong></li>
        <li><label>offset:</label> <strong>${offsetX}</strong> <i>,</i> <strong>${offsetY}</strong> </li>
        <li><label>blur:</label> <strong>${blurRadius}</strong> <i>,</i> <label>spread:</label> <strong>${spread}</strong></li>
      </script>

    </div>
  </body>
</html>
